import { defineConfig } from "drizzle-kit";

export default defineConfig({
  dialect: "postgresql",
  schema: "./server/database/schema.ts",
  out: "./server/database/migrations",
});

import IconsResolver from "unplugin-icons/resolver";
import Components from "unplugin-vue-components/vite";

export default defineNuxtConfig({
  hub: {
    blob: true,
    bindings: {
      hyperdrive: {
        POSTGRES: process.env.NUXT_HUB_HYPERDRIVE_ID,
      },
    },
  },

  future: { compatibilityVersion: 4 },

  nitro: {
    routeRules: {
      "/": { prerender: true },
    },
  },

  experimental: {
    payloadExtraction: false,
  },

  typescript: {
    tsConfig: {
      compilerOptions: {
        noUncheckedIndexedAccess: false,
      },
    },
  },

  components: {
    dirs: [
      "~/components/shared",
      "~/components/ui/editor",
      "~/components/ui/sidebar",
      "~/components/ui",
      "~/components",
    ],
  },

  modules: [
    "@nuxtjs/tailwindcss",
    "@pinia/nuxt",
    "unplugin-icons/nuxt",
    "@vite-pwa/nuxt",
    "@nuxt/scripts",
    "@nuxthub/core",
  ],

  tailwindcss: {
    viewer: false,
  },

  pwa: {
    registerType: "autoUpdate",
    workbox: {
      navigateFallback: undefined,
      navigateFallbackDenylist: [/^(?!\/$).*/],
      maximumFileSizeToCacheInBytes: 1024 * 1024 * 10,
      globPatterns: [
        "**/*.{js,css,html,png,jpg,jpeg,svg,ico,json,txt,ttf,woff,woff2}",
      ],
    },

    manifest: {
      name: "Chalk",
      short_name: "Chalk",
      theme_color: "#18181b",
      background_color: "#18181b",
      icons: [
        {
          src: "/pwa-192x192.png",
          sizes: "192x192",
          type: "image/png",
        },
        {
          src: "/pwa-512x512.png",
          sizes: "512x512",
          type: "image/png",
        },
        {
          src: "/pwa-512x512.png",
          sizes: "512x512",
          type: "image/png",
          purpose: "any maskable",
        },
      ],
    },
  },

  app: {
    head: {
      title: "Create beautiful images of your source code",
      charset: "utf-8",
      viewport: "width=device-width, initial-scale=1.0",
      meta: [
        {
          name: "description",
          content: "Turn your source code into beautiful images",
        },
        { name: "twitter:card", content: "summary_large_image" },
        {
          name: "twitter:title",
          content: "Chalk.ist - Create beautiful images of your source code",
        },
        { name: "twitter:domain", content: "https://chalk.ist" },
        { name: "twitter:creator", content: "@idered" },
        { name: "twitter:url", content: "https://chalk.ist" },
        { name: "twitter:image", content: "https://chalk.ist/og-image.jpg" },
        {
          name: "twitter:description",
          content: "Turn your source code into beautiful images",
        },
        {
          property: "og:title",
          content: "Chalk.ist - Create beautiful images of your source code",
        },
        { property: "og:type", content: "website" },
        { property: "og:url", content: "https://chalk.ist" },
        { property: "og:image", content: "https://chalk.ist/og-image.jpg" },
        {
          property: "og:description",
          content: "Turn your source code into beautiful images",
        },
      ],
      link: [
        { rel: "icon", href: "/favicon.ico" },
        {
          rel: "apple-touch-icon",
          sizes: "180x180",
          href: "/apple-touch-icon.png",
        },
      ],
      htmlAttrs: {
        lang: "en",
        class: "bg-slate-900",
      },
      bodyAttrs: {
        class:
          "font-inter text-slate-500 subpixel-antialiased selection:bg-blue-600/50 selection:text-white",
      },
    },
  },

  scripts: {
    globals: {
      umami: [
        {
          src: "https://umami.chalk.ist/script.js",
          "data-website-id": "e26d67be-7367-4221-9f0d-28a4787bf633",
          crossorigin: false,
        },
        { trigger: "onNuxtReady" },
      ],
    },
  },

  vite: {
    plugins: [
      Components({
        resolvers: [IconsResolver()],
      }),
    ],

    optimizeDeps: {
      include: [
        "@vueuse/core",
        "@vueuse/head",
        "@vueuse/components",
        "@vueuse/integrations/useFuse",
      ],
    },
  },

  css: [
    "~/styles/main.css",
    "~/styles/color-picker.css",
    "~/styles/geist-mono.css",
    "~/styles/nova.css",
    "@fontsource/fira-code/400.css",
    "@fontsource/fira-code/700.css",
    "@fontsource/ibm-plex-mono/400.css",
    "@fontsource/ibm-plex-mono/700.css",
    "@fontsource/inter/400.css",
    "@fontsource/inter/500.css",
    "@fontsource/inter/600.css",
    "@fontsource/inter/700.css",
    "@fontsource/jetbrains-mono/400.css",
    "@fontsource/jetbrains-mono/700.css",
    "@fontsource/source-code-pro/400.css",
    "@fontsource/source-code-pro/700.css",
    "@fontsource/overpass-mono/400.css",
    "@fontsource/overpass-mono/700.css",
  ],

  compatibilityDate: "2024-10-23",
});

const plugin = require("tailwindcss/plugin");
/**
 * @typedef {import('tailwindcss/types').Config} BaseConfig
 *
 * @type {BaseConfig}
 */
module.exports = {
  content: ["./nuxt.config.ts", "./src/**/*.{vue,js,ts,jsx,tsx}"],
  theme: {
    extend: {
      screens: {
        pwa: { raw: "(display-mode: standalone)" },
      },

      keyframes: {
        overlayShow: {
          from: { opacity: 0 },
          to: { opacity: 1 },
        },
        contentShow: {
          from: { opacity: 0, transform: "translate(-50%, -48%) scale(0.96)" },
          to: { opacity: 1, transform: "translate(-50%, -50%) scale(1)" },
        },
        slideDownAndFade: {
          from: { opacity: 0, transform: "translateY(-2px)" },
          to: { opacity: 1, transform: "translateY(0)" },
        },
        slideLeftAndFade: {
          from: { opacity: 0, transform: "translateX(2px)" },
          to: { opacity: 1, transform: "translateX(0)" },
        },
        slideUpAndFade: {
          from: { opacity: 0, transform: "translateY(2px)" },
          to: { opacity: 1, transform: "translateY(0)" },
        },
        slideRightAndFade: {
          from: { opacity: 0, transform: "translateX(-2px)" },
          to: { opacity: 1, transform: "translateX(0)" },
        },
        "shine-r": {
          "0%": { right: "100%", opacity: 0 },
          "50%": { opacity: 1 },
          "90%": { right: "-10%" },
          "100%": { opacity: 0 },
        },
        "shine-b": {
          "0%": { bottom: "100%", opacity: 0 },
          "50%": { opacity: 1 },
          "90%": { bottom: "-10%" },
          "100%": { opacity: 0 },
        },
        "shine-l": {
          "0%": { left: "100%", opacity: 0 },
          "50%": { opacity: 1 },
          "90%": { left: "-10%" },
          "100%": { opacity: 0 },
        },
        "shine-t": {
          "0%": { top: "100%", opacity: 0 },
          "50%": { opacity: 1 },
          "90%": { top: "-10%" },
          "100%": { opacity: 0 },
        },
      },
      fontFamily: {
        inter: ["Inter", "sans-serif"],
        mono: ["JetBrains Mono", "monospace"],
      },
      animation: {
        overlayShow: "overlayShow 150ms cubic-bezier(0.16, 1, 0.3, 1)",
        contentShow: "contentShow 150ms cubic-bezier(0.16, 1, 0.3, 1)",
        slideDownAndFade:
          "slideDownAndFade 400ms cubic-bezier(0.16, 1, 0.3, 1)",
        slideLeftAndFade:
          "slideLeftAndFade 400ms cubic-bezier(0.16, 1, 0.3, 1)",
        slideUpAndFade: "slideUpAndFade 400ms cubic-bezier(0.16, 1, 0.3, 1)",
        slideRightAndFade:
          "slideRightAndFade 400ms cubic-bezier(0.16, 1, 0.3, 1)",
      },
      colors: {
        slate: {
          500: "hsl(240, 3%, 55%)",
          600: "#6a6a71",
          700: "#1e1e25",
          800: "#101014",
          900: "#0b0b0d",
        },

        brand: {
          50: "#ebfef7",
          100: "#cefdea",
          200: "#a1f9da",
          300: "#64f1c8",
          400: "#27e0b1",
          500: "#02e1af",
          600: "#00a27f",
          700: "#008269",
          800: "#006654",
          900: "#005447",
        },
      },
    },
  },
  plugins: [
    require("tailwindcss-easing"),
    require("@tailwindcss/typography"),
    plugin(({ addVariant }) => {
      addVariant("light", ".is-light-theme &");
    }),
  ],
};
